import React, { Fragment } from 'react';

const Header = ({selection}) => {

    return(
    <Fragment>
        <h1>{selection}</h1>
        <h1>{'btn ' + (("${selection}" === 'Application') ? 'True' : 'False')}</h1>
        <div class="d-flex flex-row justify-content-center">
            <div class="p-2"><a class={"btn " + ({selection} === 'Application' ? 'btn-primary' : 'btn-outline-primary')} href="#" role="button">Applications</a></div>
            <div class="p-2"><a class="btn btn-outline-primary" href="#" role="button">Vendors</a></div>
            <div class="p-2"><a class="btn btn-outline-primary" href="#" role="button">Other</a></div>
        </div>
    </Fragment>);
};

export default Header;
